# Function to send message to Groq API
def send_message_to_groq(messages):
    data = {
        "model": "llama-3.3-70b-versatile",
        "messages": messages,
        "temperature": 0.7
    }
    return requests.post(GROQ_API_URL, headers=headers, json=data)

# Function to process user query

def process_user_query(user_input):
    user_input_lower = user_input.lower()

    try:
        # Check if the user query is related to moving average
        if "moving average" in user_input_lower:
            ticker = extract_ticker_from_input(user_input)
            df, stock = fetch_data(ticker)
            ma = calculate_moving_average(df).iloc[-1]  # Get the latest moving average
            return f"The latest moving average for {ticker.upper()} is {round(ma, 2)}"

        # ROI Calculation
        elif "roi" in user_input_lower:
            ticker = extract_ticker_from_input(user_input)
            roi = calculate_roi(ticker)
            return f"The ROI for {ticker.upper()} is {round(roi, 2)}%."

        # RSI Calculation
        elif "rsi" in user_input_lower:
            ticker = extract_ticker_from_input(user_input)
            df, stock = fetch_data(ticker)
            rsi = calculate_rsi(df).iloc[-1]  # Get the latest RSI
            return f"The RSI for {ticker.upper()} is {round(rsi, 2)}"

        # EMA Calculation
        elif "ema" in user_input_lower:
            ticker = extract_ticker_from_input(user_input)
            df, stock = fetch_data(ticker)
            ema = calculate_ema(df).iloc[-1]  # Get the latest EMA
            return f"The EMA for {ticker.upper()} is {round(ema, 2)}"

        # Sentiment Analysis
        elif "sentiment" in user_input_lower:
            ticker = extract_ticker_from_input(user_input)
            sentiment_df = analyze_news_sentiment_finbert(ticker)
            
            if sentiment_df.empty:
                return f"Sorry, no sentiment data available for {ticker.upper()}."
            
            # Weighted average sentiment score
            weighted_avg_sentiment = (
                (sentiment_df["Sentiment_Score"] * sentiment_df["Confidence"]).sum()
                / sentiment_df["Confidence"].sum()
            )
            return f"The weighted sentiment score for {ticker.upper()} is {round(weighted_avg_sentiment, 4)}"

        # Fetch Fundamentals like P/E Ratio
        elif "fundamentals" in user_input_lower or "p/e" in user_input_lower:
            ticker = extract_ticker_from_input(user_input)
            fundamentals = fetch_fundamentals(ticker)
            
            pe_ratio = fundamentals.get('P/E Ratio', 'N/A')
            forward_pe = fundamentals.get('Forward P/E', 'N/A')
            dividend_yield = fundamentals.get('Dividend Yield', 'N/A')
            
            return f"{ticker.upper()} Fundamentals:\nP/E Ratio: {pe_ratio}\nForward P/E: {forward_pe}\nDividend Yield: {dividend_yield}"

        # Default case (if no recognized queries found)
        else:
            return None  # Let the main loop know: fallback to LLM (Large Language Model)

    except Exception as e:
        # Enhanced error handling for clarity
        print(f"‚ö†Ô∏è Error processing query: {e}")
        return "Sorry, I couldn't process your request due to an error. Please try again later."

