def extract_tickers_from_input(user_input):
    # Assuming you say "compare apple and microsoft"
    companies = user_input.lower().replace(",", "").split("and")
    tickers = []
    for company in companies:
        tickers.append(extract_ticker_from_input(company.strip()))
    return tickers


# Main function

def main():
    print(Fore.GREEN + "ü§ñ FinBot: Hello! How can I assist you today? (Type 'exit' to quit)\n")

    while True:
        user_input = input(Fore.CYAN + "üßë You: " + Style.RESET_ALL)

        if user_input.strip().lower() in ["exit", "quit"]:
            with open(CHAT_HISTORY_FILE, "w") as f:
                json.dump(conversation, f, indent=4)
            type_print("ü§ñ FinBot: Goodbye! üëã", color=Fore.GREEN)
            break

        # Try to process locally first
        local_response = process_user_query(user_input)

        if local_response:
            print()
            type_print(f"ü§ñ FinBot: {local_response}", color=Fore.GREEN)
            print()

            conversation.append({"role": "user", "content": user_input})
            conversation.append({"role": "assistant", "content": local_response})
            continue

        # If not processed locally, send to Groq LLM
        conversation.append({"role": "user", "content": user_input})

        spinner = Spinner("FinBot is thinking")
        spinner.start()

        response = send_message_to_groq(conversation)
        spinner.stop()

        if response.status_code == 200:
            response_json = response.json()
            assistant_reply = response_json['choices'][0]['message']['content']

            conversation.append({"role": "assistant", "content": assistant_reply})

            print()
            type_print(f"ü§ñ FinBot: {assistant_reply}", color=Fore.GREEN)
            print()
        else:
            print(Fore.RED + f"Request failed: {response.status_code}")
            print(Fore.RED + response.text)

if __name__ == "__main__":
    main()
